import Form from 'react-bootstrap/Form';
import React, { useEffect, useState } from "react"

const [crimeCategorties, setCrimeCategorties] = useState([])
const policeDataCrimeCategorties = () => {
  fetch("https://data.police.uk/api/crime-categories")
    .then(response => {
      return response.json()
    })
    .then(data => {
      setCrimeCategorties(data)
    })
}

const [force, setForce] = useState([])
const policeForces = () => {
  fetch("https://data.police.uk/api/forces")
    .then(response => {
      return response.json()
    })
    .then(data => {
      setForce(data)
    })
}

function userSelectionForm() {
  return (
    <>
      <Form.Group className="mb-3">
        <Form.Label>Disabled input</Form.Label>
        <Form.Control placeholder="Disabled input" />
      </Form.Group>
      <Form.Group className="mb-3">
        <Form.Label>Disabled select menu</Form.Label>
        <Form.Select>
          <option>Disabled select</option>
        </Form.Select>
      </Form.Group>
      <Form.Group className="mb-3">
        <Form.Check type="checkbox" label="Can't check this" />
      </Form.Group>
    </>
  );
}

export default userSelectionForm;
